import Vue from 'vue'
import VueRouter from 'vue-router'
import PetHome from '../views/PetHome'
import LoginPage from '../views/LoginPage'
Vue.use(VueRouter)
const routes = [
    {
        path: '/PetHome',
        name:PetHome,
        component: PetHome,
    },
    {
        path: '/LoginPage',
        name: LoginPage,
        component: LoginPage,
    }, 
    {
        path: '/RegisterPage',
        name: RegisterPage,
        component: RegisterPage,
    }
]

const router = new VueRouter({
    routes
})

export default router
